import OnlyHeader from "components/Headers/OnlyHeader";
import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCircle } from "@fortawesome/free-solid-svg-icons";

import { Card, Col, Container, Progress, Row } from "reactstrap";

const Attendence = () => {
     const progressValue = 50; // Set the progress value here (between 0 and 100)

  const progressBarStyles = {
    width: '150px',
    height: '150px',
    borderRadius: '50%',
    position: 'relative',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  const circleStyles = {
    width: '100%',
    height: '100%',
    position: 'absolute',
    top: '0',
    left: '0',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  const progressTextStyles = {
    position: 'relative',
    zIndex: '1',
    fontSize: '24px',
    fontWeight: 'bold',
  };
  return (
    <>
      <OnlyHeader />
      <Container>
        <Row>
          <Col md="4" className="p-4">
            <Card className="py-7 px-2">
              <h1 className="">Operating System</h1>
              {/* <FontAwesomeIcon icon={faCircle} /> */}

              <Progress
                value={50} // Set the progress value here (between 0 and 100)
                className=" "
                style={''}
              >50%</Progress>
            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Attendence;
